import React from 'react'

 const Pagenation = ({page, pages, onChangeHandler}) => {
     let middlePagenation;
     if(pages <= 5) {
         middlePagenation = [...Array(5).map((_, indx) => 
            <button
            key={indx+1}
            className="mid-pagenation-btn"
            onClick={onChangeHandler(indx+1)}
            >
                {indx+1}
            </button>
            )]
     }
    return pages && (
            <section className="stories-pageCount">
                <button onClick={onChangeHandler(page - 1)} className="btn prev-btn"></button>
                <button onClick={onChangeHandler(page + 1)} className="btn next-btn"></button>
            </section>

    )
}
export default Pagenation
